import {Box, Button, ButtonText, View, Text, AvatarFallbackText, Avatar} from '@gluestack-ui/themed';



const Bagview = ()=>{

    return(
        <Box  justifyContent="center" alignItems="center" mt={"$10"} bgColor='black' width={'$full'}>
            
            <Button position='absolute' width="305px" backgroundColor='#FFA600' color='white' marginTop={"100%"}>
                <ButtonText >
                    Order
                </ButtonText>

            </Button>

        </Box>

    ); 
}


export default Bagview;
